    // },
    // {
    //   name: "beer",
    //   info: ""
    // }
  ],
  activeInfo: 0,
  checked: [],
  openInfo: false,
  openAdd: false
});

ReactDOM.render(
  <Provider store={store}>
    <App />
  </Provider>,
  document.getElementById("root")
);
